import { Button } from 'native-base'
import React from 'react'
import { View, Text } from 'react-native'

const UrgentTimeline = () => {
    return (
        <View>
            <Button onPress={(value) => setValue(value) }> Urgent </Button>
        </View>
    )
}

export default UrgentTimeline
